import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const landing = () => {
    return (
        <div className='App'>
        <div className='main-div'>
            
            <h2>ROI Calculator</h2>
            <FontAwesomeIcon icon="multiply" />

        
        </div>
        </div>

    );
}

export default landing;
